def getTile(row, column, width=10, height=18, offsetX=0, offsetY=0, translate=True):
        if translate:
                return OL.translateBitmap([[tileset[j][i] for i in range(column*width+offsetX, column*width+width+offsetX, 1)] for j in range(row*height+offsetY, row*height+height+offsetY, 1)])
        else:
                return [[tileset[j][i] for i in range(column*width+offsetX, column*width+width+offsetX, 1)] for j in range(row*height+offsetY, row*height+height+offsetY, 1)]
